import { Routes } from "react-router-dom";
import { Route } from "react-router-dom";
import IndexPage from "../pages/IndexPage/IndexPage";

const AppRoutes = () => {
    return (
        <Routes>
            <Route path="/" element={<IndexPage />}/>
        </Routes>
    )
}

export default AppRoutes;
